import React, { useContext, useState, useDispatch } from 'react';



function SignUp(props) {

    const dispath = useDispatch();

    return (
        <form action="sign" action="/add" method="POST" id='signUpForm'>
            <label htmlFor="ID">ID</label>
            <input type="text" name='signUpid' />
            <label htmlFor="PW">PW</label>
            <input type="password" name='signUppw' />
            <label htmlFor="PWchk">PW check</label>
            <input type="password" name='signUppwChk' />
            <label htmlFor="email">Email</label>
            <input type="email" name='signEmail'/>
            <input type="submit" value="submit" id='signUpBtn'/>
        </form>
    )
}

export default SignUp;
